import java.util.PriorityQueue;

public class Priorityqueue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		PriorityQueue<String> data = new PriorityQueue<>();
		data.add("jaswanth");
		data.add("a");
		data.add("zeebra");
		data.add("f");
		for(String s : data) {
			System.out.println(s);
		}

	}

}
